if mibBuilder.loadTexts: etherMIB.setContactInfo("WG E-mail: hubmib@ietf.org\nTo subscribe: hubmib-request@ietf.org\n\n       Chair: Dan Romascanu\n      Postal: Avaya Inc.\n              Atidum Technology Park, Bldg. 3\n              Tel Aviv 61131\n              Israel\n         Tel: +972 3 645 8414\n      E-mail: dromasca@avaya.com\n\n     Editor: John Flick\n     Postal: Hewlett-Packard Company\n             8000 Foothills Blvd. M/S 5557\n             Roseville, CA 95747-5557\n             USA\n        Tel: +1 916 785 4018\n        Fax: +1 916 785 1199\n     E-mail: johnf@rose.hp.com")
if mibBuilder.loadTexts: etherMIB.setDescription("The MIB module to describe generic objects for\nethernet-like network interfaces.\n\nThe following reference is used throughout this\nMIB module:\n\n[IEEE 802.3 Std] refers to:\n   IEEE Std 802.3, 2002 Edition: 'IEEE Standard\n\n   for Information technology -\n   Telecommunications and information exchange\n   between systems - Local and metropolitan\n   area networks - Specific requirements -\n   Part 3: Carrier sense multiple access with\n   collision detection (CSMA/CD) access method\n   and physical layer specifications', as\n   amended by IEEE Std 802.3ae-2002:\n   'Amendment: Media Access Control (MAC)\n   Parameters, Physical Layer, and Management\n   Parameters for 10 Gb/s Operation', August,\n   2002.\n\nOf particular interest is Clause 30, '10 Mb/s,\n100 Mb/s, 1000 Mb/s, and 10 Gb/s Management'.\n\nCopyright (C) The Internet Society (2003).  This\nversion of this MIB module is part of RFC 3635;\nsee the RFC itself for full legal notices.")
